INSERT INTO `advertiser_info` VALUES (1, '中国工程院第十五次院士大会和中国科学技术协会第十次全国代表大会在北京人民大会堂隆重召开。', '<p><strong>	</strong><strong style=\"color: rgb(0, 0, 255);\">2021年5月28日，中国科学院第二十次院士大会、中国工程院第十五次院士大会和中国科学技术协会第十次全国代表大会在北京人民大会堂隆重召开。中共中央总书记、国家主席、中央军委主席习近平出席大会并发表重要讲话。</strong></p>', '2023-02-25 10:00:08');
INSERT INTO `advertiser_info` VALUES (2, '新时代科技强国战略', '<p><strong style=\"color: rgb(0, 0, 0);\">科技强国是现代化强国的核心要义，科技现代化是中国式现代化的重要内容。把握新发展阶段、贯彻新发展理念、构建新发展格局，推动高质量发展，迫切需要从战略体系视角，在社会主义现代化强国建设全局中系统推进新时代科技强国建设，具体包含：（1）界定科技强国战略内涵，建立“战略环境-战略目标-战略能力-战略行动”战略体系分析框架；（2）分析科技强国建设战略环境，准确研判长远发展大势，牢牢把握科技战略机遇；（3）丰富科技强国建设战略目标，进入创新型国家行列和前列，建成世界科技强国；（4）提升科技强国建设战略能力，建设国家创新体系，强化国家战略科技力量和国家战略人才力量；（5）深入推进科技强国建设战略行动，全面实施创新驱动发展战略，实现高水平科技自立自强。</strong></p>', '2023-02-25 10:00:03');
INSERT INTO `advertiser_info` VALUES (3, '以科技强国引领现代化强国建设', '<p><strong style=\"color: rgb(43, 43, 43);\">习近平总书记在中国科学院第二十次院士大会、中国工程院第十五次院士大会和中国科协第十次全国代表大会上发表的重要讲话，立意高远、内涵丰富、思想深邃，深入总结了我国科技事业发展取得的辉煌成就，科学分析了新一轮世界科技革命和产业变革大势，深刻阐明了立足新发展阶段实现我国科技自立自强的一系列重大问题，对当前和今后一个时期我国科技改革发展作出重大战略部署，对全国科技战线提出明确要求、寄予厚望。全国科技战线深受鼓舞、倍感振奋，以强烈的政治担当和历史主动精神，把习近平总书记重要讲话精神全面贯彻到科技改革发展的创新实践中。</strong></p>', '2023-02-25 10:00:00');
INSERT INTO `advertiser_info` VALUES (4, '科技部部长王志刚：开启建设科技强国新阶段', '<p><strong>“科技创新在党和国家事业全局中的地位提升前所未有，作用发挥前所未有，科技赋能成为高质量发展的显著标志，科技创新成为引领现代化建设的重要动力。”在国务院新闻办公室今天举行的“权威部门话开局”系列主题新闻发布会上，科技部部长王志刚表示。</strong></p>', '2023-02-25 09:59:52');
INSERT INTO `advertiser_info` VALUES (5, '建设科技强国开启新阶段', '<p><strong>天和、问天、梦天三舱齐聚天宇，中国空间站傲立太空，夸父探日、青藏科考、微纳卫星、量子传输、质子治疗等一批重大创新成果竞相涌现；</strong></p><p><strong>全社会研发经费支出首次突破3万亿元，研发投入强度首次突破2.5%，基础研究投入比重连续4年超过6%；</strong></p><p><strong>一批关键核心技术攻关取得突破，国家战略科技力量建设迈出新步伐，“科技冬奥”保障北京冬奥会高质量办赛高水平参赛，科研攻关为全国疫情防控取得重大决定性胜利作出重要贡献；</strong></p><p><strong>……</strong></p><p><strong>2022年，我国科技创新成果丰硕、捷报频传。</strong></p><p><strong>“科技创新在党和国家事业全局中的地位提升前所未有，作用发挥前所未有，科技赋能成为高质量发展的显著标志，科技创新成为引领现代化建设的重要动力。”2月24日，在国新办举行的“权威部门话开局”系列主题新闻发布会上，科技部部长王志刚表示。</strong></p>', '2023-02-25 10:12:20');
