INSERT INTO `shitishu_info` VALUES (1, 'Spring Boot技术内幕：架构设计与实现原理', '<p><span style=\"color: rgb(101, 101, 101);\">经过几年的发展，Spring Boot几乎已成为Java企业级开发的标准框架，它为开发人员提供了极其方便的项目框架搭建、软件集成功能，极大地提升了开发人员的工作效率，减少了企业的运营成本。而Spring Boot又极其简单易用，一个新手按照官方文档的指导在十几分钟内就能创建一个可运行的Spring Boot项目。</span></p><p><br></p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p class=\"ql-align-center\"><br></p><p><span style=\"color: rgb(101, 101, 101);\">Spring Boot的研发团队实现了用软件改变世界的梦想，实现了另外一种形式的创新。有句话说得非常好：“世界上90%的行业都值得重做一遍，当你把它们做到极致时，那便是创新。”Spring Boot做到了这一点，也得到了市场和用户的认可。</span></p><p><br></p><p><span style=\"color: rgb(101, 101, 101);\">Spring Boot为开发人员提供了方便，但一些开发人员并不了解Spring Boot为什么可以带来方便的底层逻辑，也没有尝试借鉴Spring Boot的这种创新。这不仅会导致他们在使用Spring Boot的过程中不能深层次发挥它的优势，还会导致在大范围应用Spring Boot之后出现各种问题却找不到解决办法的情况，更别说借鉴Spring Boot的创新了。</span></p><p><br></p><p><span style=\"color: rgb(101, 101, 101);\">作为软件开发人员，我们都知道设计模式很重要。为什么重要呢？因为这些设计模式是解决编程过程中一些典型问题的标准方法，已经被验证和认可。学习了这些解决方案，在遇到类似的问题时，软件开发人员便不用“重复造轮子”，直接借鉴经验即可。</span></p>');
INSERT INTO `shitishu_info` VALUES (2, 'SpringBoot揭秘：快速构建微服务体系', '<p><span style=\"color: rgb(101, 101, 101);\">本书以微服务的基本概念介绍性开篇， 逐步引出Java平台下打造微服务的利器SpringBoot微框架， 从SpringBoot微框架的出身和源头， 循序渐进，一步步为大家剖析了SpringBoot微框架的设计理念和原理，并对框架的重点功能和模块进行了逐一讲解。</span></p><p><br></p><p class=\"ql-align-center\"><img src=\"data:image/png;base64,\"></p><p><br></p><p>“框架，体系，生态”， 三者循序渐进，相辅相成，本书*精彩的部分在于， 在大家对SpringBoot微框架已经有了基本的认识之后， 我们将一起探索如何基于SpringBoot微框架打造一套完备的微服务体系。</p><p><br></p><p>SpringBoot微框架依托Java平台和Spring框架，拥有良好的可扩展性和可定制性，为了说明这一点，我们单独开辟了一章内容，为大家介绍 如何使用Scala和SpringBoot微框架来开发和交付相应的微服务，并且围绕着Scala和SpringBoot如何打造相应的工具， 技术产品等支持来提高相应微服务的交付效率。</p><p><br></p><p><strong>作者简介：</strong></p><p><br></p><p><span style=\"color: rgb(101, 101, 101);\">王福强，资深Java技术专家和架构师，具有多年一线开发经验和技术团队管理经验。在计算机语言、并发与并行编程、分布式系统设计与开发、大数据、实时计 算等领域都积累了丰富的经验。先后在英极、花旗、*等金融和互联网企业任职，主导和参与了多个重要的大型项目。现任挖财技术VP兼首席架构师。</span></p>');
